import React from "react";
import P, { Size, Weight } from "../components/atoms/P/P";
import Button from "../components/atoms/Button/Button";

const Home = () => {
  return (
    <div>
      <P text="아아앙" size={Size.l} weight={Weight.m}></P>
      <Button>버튼</Button>
    </div>
  );
};

export default Home;
